import React from 'react';

function ChangingButtons(props) {
    let curChoice;
    if( props.isManager ){
        curChoice = 
        <div style={{display: 'flex', flexDirection:'column', justifyContent:'space-between'}}>
            <Button> View </Button>
            <Button> Edit </Button>
            <Button> Delete </Button>
        </div>
    }
    else{
        <div>
        <Button> View </Button>
    </div>
    }
  return (
      {curChoice}
  );
}

export default ChangingButtons;
